export default function Hero() {
  return (
    <div class="mt-24 container">
      <h1 class="text-white text-7xl">Youth Financial Analysis Competition</h1>
      <p class="text-white">
        The Youth Financial Analysis Competition is a free, international stock
        pitch event for high school students. Participants work individually or
        in teams of up to 4 to compete for a $800 cash prize. Join youths from
        over 10 countries today, or become a YFAC ambassador for your country!
      </p>
    </div>
  );
}
